export const GetId = () => {
    return 'dfdsf4343r'
}

export function GetThing(funcToRun, errorFunc) {
    console.log(errorFunc)
    setTimeout(() => {
        funcToRun();
    }, 1000);
    // errorFunc is a function for 'error' in fetch API, not ran now.
}
